function generatePDF(data, columnHeaders, fileName, title) {
    const tableData = [columnHeaders.map(header => header.headerName)];

    data.forEach(item => {
        const rowData = columnHeaders.map(header => item[header.field]);
        tableData.push(rowData);
    });

    const logo1IMG = 'data:image/png;base64,';
    const logo2IMG = 'data:image/png;base64,'
    const footerIMG = 'data:image/png;base64,';

    const docDefinition = {
        content: [
            {
                image: logo1IMG,
                width: 100,
                height: 100,
                margin: [20, 0],
            },
            {
                text: title,
                style: 'header',
                margin: [0, 20],
            },
            {
                table: {
                    headerRows: 1,
                    widths: columnHeaders.map(() => 'auto'),
                    body: tableData,
                },
            },
        ],
        footer: {
            columns: [
                {
                    image: logo2IMG,
                    width: 50,
                    height: 50,
                   // margin: [300, 0],//left top
                },
                {
                    text: 'SmartBit Eventos 2023',
                   // margin: [0, -210],
                    alignment: 'center',
                    fontSize: 14,
                },
            ],
        },
        styles: {
            header: {
                fontSize: 18,
                bold: true,
            },
        },
    };

    try {
        const pdfDocGenerator = pdfMake.createPdf(docDefinition);
        pdfDocGenerator.download(fileName);
    } catch (error) {
        console.error('Error al generar el PDF:', error);
    }
}
